import React from 'react';
import {Route, BrowserRouter, Switch} from 'react-router-dom'
import Bracket from './pages/Bracket'

function App() {
  return (
    <BrowserRouter>
        <Switch>
            <Route path='/' exact component={Bracket}/>
        </Switch>
    </BrowserRouter>
  );
}

export default App;
